window.bookSummaryJSON = "<p><b>A city destroyed. An old threat returns. What will Salvos do next?</b></p> <p>After fleeing from the destruction of Vamont, Salvos splits from her companions to begin her quest for knowledge and power. She will study under both Fairykind and Humankind, if necessary, to learn the skills she needs to reunite with her first companion.</p> <p>Meanwhile, Daniel shall have to face his past, while Edithe will continue her fight in the bloody company war between the Valiant Dreamers and Iron Champions.</p> <p>Alone and without her companions, Salvos will have no choice but to adapt and overcome these new obstacles that bar her path to her goal.</p>"; 
